(49963, 1476, 0, 10, 'neige', '', '2010-06-28 00:00:00', 2012, 0, 1, 8, '下了冬天第一場雪\r\n大約在下午兩點\r\n瞬間就白茫茫一片\r\n街上的腳步更急了些\r\n被融雪浸濕的大衣\r\n回家的路還有好遠 我低頭向前\r\n\r\n今天的我已不再像從前\r\n獨自面對這世界\r\n陌生的城市很疲憊\r\n\r\n遠方的你是否了解\r\n當你說著你的冒險\r\n我好想要在你身邊\r\n\r\n\r\n\r\n雪已經下了好幾天\r\n開始懷念起綠葉\r\n開始期待融雪時節\r\n稱了傘我吐著白煙\r\n下午四點街道漆黑\r\n回家的路還有好遠 我低頭向前\r\n\r\n踏過一片泥濘的雪\r\n今天還是自己面對\r\n如此遙遠的思念\r\n\r\n慢慢的我們漸行漸遠\r\n不同的城市與視野\r\n這場初雪把一切覆掩\r\n\r\n\r\n\r\n我一個人走在大街\r\n城市結凍白雪眠眠\r\n幾十年後我們在哪邊\r\n撥開雪我把秘密放裡面\r\n曲著身緩緩平躺在雪原\r\n慢慢慢慢我就這樣長眠 ', '', 588, '', '', '', '', '', '', 0, 0, 0, '2012-06-26 07:14:30', '2015-03-12 13:53:33', '0000-00-00 00:00:00'),
