(50067, 144456, 0, 0, 'Tinker Bell(feat.Shawn Hsu徐向立)', 'Tinker Bell是由J. M. Barrie所著的近代童話劇及小說Peter Pan（中譯“彼得潘”/“小飛俠”）中的一個小仙女角色。她最廣為人之的形象則是後來在Walt Disney當中只能以類似“鈴鈴”的鈴鐺聲（據說是只有仙女和精靈才懂的語言）發聲溝通。\r\n\r\n這首歌主要是藉由Peter Pan本人後來在塵世成長, 老化, 無奈的淡化了年少時的純真感動的同時卻又無法完全忘懷曾經擁有的赤子回憶這般的煎熬來旁敲側擊關於人生歷程中的真真假假, "現實“的可破性, 以及回憶與情緒這類“非實體”的力度。詞曲和演唱方式則是以偏向音樂劇的方式來表達, 試圖重建一些原著中自然質樸卻又甜美溫馨的氛圍。\r\n\r\nGuitar  柯如茵\r\n混音    葉育軒', '2012-06-26 00:00:00', 2012, 0, 2, 3, 'She came down to me, the way she said it would be \r\n她從天而降下來找我了, 就像她當初說的一樣 \r\nIt didn''t matter anymore to me, was it a dream, was it reality \r\n這究竟是夢還是真實, 對我來說已經一點都不重要了 \r\nShe asked me what it would be, should we dance or should we sing \r\n她問我想做什麼呢？我們該跳支舞還是唱首歌呢？ \r\nIt didn''t matter anymore to me, coz with her I was happy \r\n對我來說已經一點都不重要了, 因為和她在一起我就是快樂的 \r\n＿＿＿＿＿ \r\nWe sat down beneath a tree, just the perfect place to be \r\n我們在一顆樹底下坐了下來, 剛好就是個最完美的地方 \r\nAway from the rain and the wind, a place to dance and sing \r\n遠離風雨, 一個可以唱歌跳舞的好地方 \r\nShe asked me if I could tell, dreams from reality \r\n她問我能不能分辨現實和夢境的差別 \r\nIt didn''t matter anymore to me, coz with her I was happy \r\n對我來說一點也不重要了, 只要和她在一起我就是快樂的 \r\n＿＿＿＿＿ \r\nTime hasn''t been kind to me, but I am more than used to it \r\n時間對我向來不仁慈, 但是我也早就習慣了 \r\nThere''s not much in my memory, but this cold cold reality \r\n我的記憶裡也早就沒剩下太多東西, 除了這個冷冷的現實 \r\nAn old man like me has forgotten how to feel \r\n像我這樣的老人早就忘了要怎麼去感覺呀 \r\nBut the never-aging, child in me is willing and ready \r\n但是我心裡那個從來不會蒼老的小孩卻永遠都是躍躍欲試的 \r\n＿＿＿＿＿ \r\nOh please, my little fairy, I''m in love, can''t you see \r\n拜託妳, 我的小仙女, 我是愛妳的, 妳難道不知道嗎？ \r\nIt''s not what you say to me but the way you make it ring \r\n你對我說什麼並不重要, 而是妳讓那些字變得每個都悅耳無比 \r\nOh please, my little fairy, I''m in love, can''t you see \r\n拜託妳, 我的小仙女, 我是愛妳的, 妳難道不知道嗎？ \r\nWhenever you flap your wings I know you''re what I''ve been missing \r\n每當妳揮動著翅膀我就知道我一直都在想念著妳/我一直都沒有妳 \r\nThere''s nothing else I need, you''re what I''ve been missing \r\n我其他什麼也不需要, 妳就是我一直在追尋的 \r\nThrough all these years I could still hear you humming \r\n過了這麼多年我依舊能聽見妳在我耳邊嗡嗡作響 \r\nOh please, my little fairy, I''m in love, can''t you see \r\n拜託妳, 我的小仙女, 我是愛妳的, 妳難道不知道嗎？ \r\nWhenever you flap your wings I could still hear that \r\n每當妳拍動翅膀時, 我依舊能聽見那首 \r\nBitter-sweet melody \r\n又甜又苦的美妙旋律', '', 224, '', 'Shawn Hsu', 'Shawn Hsu', 'Tracy chen', '', '', 0, 1, 1, '2012-06-26 19:12:00', '2013-10-07 17:21:45', '2013-06-17 23:27:38'),
