(50073, 19660, 4599, 1, '夢魘', '簡單直接的穿透性樂句 ，述說著迷失自己的青年。Go Go Rise用他們一慣的直白文字與編曲力道呈現作品，這次還請來設計家Jin來參與這次的單曲聯名數位發行。', '2012-06-26 00:00:00', 2000, 20, 2, 7, '夢魘 詞: mei 曲： 阿joe\r\n發著呆看自己\r\n想起來卻又忘記\r\n躲在角落獨自默默找尋\r\n面對鏡子不停反覆練習\r\n一張一張 熟悉照片\r\n一張一張 狼狽的笑臉\r\n究竟 是誰的臉\r\n一幕一幕 熟悉畫面\r\n一雙一雙 兇狠的雙眼\r\n是誰是誰的 眼\r\n我忘了自己 迷失了自己\r\n就連空氣都在嘆息著\r\n我忘了自己 迷失在哪裡\r\n怎麼才能做自己\r\n今天是星期幾\r\n想起來卻又忘記\r\n忘記自己該有的情緒\r\n只聽見淚滴嘀嗒嗒的聲音\r\n一張一張 熟悉照片\r\n一張一張 狼狽的笑臉\r\n究竟 是誰的臉\r\n一幕一幕 熟悉畫面\r\n一雙一雙 兇狠的雙眼\r\n是誰是誰的 眼\r\n我忘了自己 迷失了自己\r\n就連空氣都在嘆息著\r\n我忘了自己 迷失在哪裡\r\n怎麼才能做自己\r\n我忘了自己 迷失了自己\r\n就連空氣都在嘆息著\r\n我忘了自己 迷失在哪裡\r\n怎麼 才能夠做 我自己', '', 258, '', '阿joe', 'mei', 'go go rise', '', '', 1, 1, 0, '2012-06-26 21:46:37', '2015-03-12 13:53:37', '0000-00-00 00:00:00'),
